        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
        <footer className="footer footer-center p-4 bg-base-300 text-base-content">
          <div>
            <p>Copyright Â© 2023 - All right reserved</p>
          </div>
        </footer>
      </Router>
    </>
  );
}

export default App;
